INSERT INTO `wp_wc_admin_notes` (`note_id`, `name`, `type`, `locale`, `title`, `content`, `icon`, `content_data`, `status`, `source`, `date_created`, `date_reminder`, `is_snoozable`) VALUES
(1, 'wc-admin-welcome-note', 'info', 'en_US', 'Nouvelle(s) fonctionnalité(s)', 'Bienvenue dans la nouvelle expérience WooCommerce ! Cette nouvelle version vous offrira un aperçu de votre boutique dans le tableau de bord. Elle vous permettra également de gérer des aspects importants de votre activité (commandes, stock, avis, etc.) depuis n\'importe quelle partie de l\'interface et d\'explorer les données de votre boutique au moyen d\'une nouvelle section de statistiques et plus encore !', 'info', '{}', 'unactioned', 'woocommerce-admin', '2020-04-21 16:23:03', NULL, 0),
(2, 'wc-admin-store-notice-setting-moved', 'info', 'en_US', 'Vous recherchez le paramètre Annonce de la boutique ?', 'Vous le trouverez désormais dans l\'outil de personnalisation.', 'info', '{}', 'unactioned', 'woocommerce-admin', '2020-04-21 16:23:03', NULL, 0),
(3, 'wc-admin-wc-helper-connection', 'info', 'en_US', 'Se connecter à WooCommerce.com', 'Connectez-vous pour obtenir des notifications et des mises à jour importantes sur les produits.', 'info', '{}', 'unactioned', 'woocommerce-admin', '2020-04-21 16:23:04', NULL, 0),
(4, 'wc-admin-add-first-product', 'info', 'en_US', 'Ajouter votre premier produit', 'Augmentez vos revenus en ajoutant des produits à votre boutique. Ajoutez des produits manuellement, importez-les à partir d\'une feuille de calcul ou migrez-les à partir d\'une autre plateforme', 'product', '{}', 'unactioned', 'woocommerce-admin', '2020-04-21 16:23:04', NULL, 0);
